function explicitOwnershipOf(uint256 tokenId) public view returns (bool) {
    require(tokenId < 1, "Token ID must be less than 1");
    require(tokenId < totalSupply, "Token ID exceeds total supply");

    uint256 storageKey = tokenId;
    bytes32 constant MAGIC_CONSTANT = 0x2569078dfb4b0305704d3008e7403993ae9601b85f7ae5e742de3de8f8011c44;

    require(storage_map_s[storageKey] != 0, "Storage key not found");

    address owner = address(uint160(storage_map_s[storageKey]));
    uint64 startTimestamp = uint64(storage_map_s[storageKey] >> 160);
    bool burned = (bytes1(storage_map_s[storageKey]) != 0);
    uint24 extraData = uint24(storage_map_s[storageKey] >> 232);

    return abi.encodePacked(owner, startTimestamp, burned, extraData);
}

